Ah, it is a triangle!
abbrev LieIdeal := LieSubmodule R L L
def lieIdealSubalgebra (I : LieIdeal R L) : LieSubalgebra R L :=
  { I.toSubmodule with lie_mem' := by intro x y _ hy; apply lie_mem_right; exact hy }
looks like a Lie ideal is definitionally a Lie submodule that happens to also be a Lie subalgebra
and this lemma is just saying that the coercions commute
